const CheckList = ({checkList}) => {

    return (
        <div className={"check-list-container"}>
            <ul>
                {checkList.map((check, index) => (
                    <li key={index}>
                        <span className={"check-box " + `${check.checked? "check-box-checked":""}`}></span>
                        <span>{check.label}</span>
                    </li>
                ))}
            </ul>
        </div>
    )
}

export default CheckList;
